《頭城文風》社區報是宜蘭縣政府文化局主辦文化部「文化資產區域環境整合計畫」的具體成果之一。本期為第一、二期合刊，以頭城著名的東嶽廟及城隍廟「大神尪」群為本期主題。 　　台灣的大神尪（神將）文化，以宜蘭頭城、新北蘆洲、桃園大溪三地最具代表性，而頭城甚至被稱為是「大神尪的故鄉」。頭城本地的大神尪又以頭城城隍廟與頭城東嶽廟為代表，大神尪的數量甚多，頭城城隍廟有26尊，頭城東嶽廟有16尊，共42尊。每逢地方廟宇節慶，數量眾多的大神尪在頭城老街傳統街巷中遶境祈安，給予地方庶民社會安定的重要精神力量，是頭城民眾心目中最重要的文化資產。但近年來每尊大神尪所屬的神明會（尪仔會）會員逐漸凋零，因而遭遇傳承上的危機；而頭城仍保有的多尊歷史悠久的大神尪，也逐漸碰觸到保存與修復的議題，值得受到更多人的關注，以使頭城大神尪文化能夠永續傳承。

